// App.js
import React from 'react';
import { AuthProvider, useAuth } from './web/AuthContext';
import { BrowserRouter as Router, Route, Routes, Navigate } from 'react-router-dom';
import Navbar from './web/Design/Navbar';
import Login from './web/cmpts/Login';
import Logout from './web/cmpts/Logout';
import Patient from './web/Users/Patient';
import Doctor from './web/Users/Doctor';
import Admin from './web/Users/Admin';
import PrivateRoute from './web/cmptsPrivateRoute'; // Import the PrivateRoute component

function App() {
  return (
    <Router>
      <AuthProvider>
        <Navbar />
        <Routes>
          <Route path="/login" element={<Login />} />
          <Route path="/logout" element={<Logout />} />
          <PrivateRoute path="/patient/*" element={<Patient />} role="patient" />
          <PrivateRoute path="/doctor/*" element={<Doctor />} role="doctor" />
          <PrivateRoute path="/admin/*" element={<Admin />} role="admin" />
        </Routes>
      </AuthProvider>
    </Router>
  );
}

export default App;
